import Header from "./Components/Body/Header";
import Intro from "./Components/Body/Intro";
import Modal from "./Components/Body/Modal";
import Menu from "./Components/Menu/Menu";
import { useState } from "react";
import CartContextProvider from "./Components/Storage/CartContextprovider";

const DUMMY_MEALS = [
  {
    id: 'm1',
    name: 'Sushi',
    description: 'Finest fish and veggies',
    price: 22.99,
  },
  {
    id: 'm2',
    name: 'Schnitzel',
    description: 'A german specialty!',
    price: 16.5,
  },
  {
    id: 'm3',
    name: 'Barbecue Burger',
    description: 'American, raw, meaty',
    price: 12.99,
  },
  {
    id: 'm4',
    name: 'Green Bowl',
    description: 'Healthy...and green...',
    price: 18.99,
  },
];



function App() {
  const [popcart, setPopCart] = useState(false);

  return (
    <div>
      {popcart && <Modal onClick = {() => {setPopCart(false)}}/>}
      <Header onClick = {() => {setPopCart(true)}}></Header>
      <Intro></Intro>
      <Menu Menu = {DUMMY_MEALS}></Menu>
    </div>
  );
}

export default App;
